import { NgModule } from '@angular/core';
import { BrowserModule } from '@angular/platform-browser';

import { AppRoutingModule } from './app-routing.module';
import { AppComponent } from './app.component';
import { NavbarComponent } from './navbar/navbar.component';
import { CliniqueComponent } from './clinique/clinique.component';
import { DocteurComponent } from './docteur/docteur.component';
import { FACComponent } from './fac/fac.component';
import { RealisationComponent } from './realisation/realisation.component';
import { TemoignagesComponent } from './temoignages/temoignages.component';
import { ConseilComponent } from './conseil/conseil.component';
import { BlanchimentComponent } from './blanchiment/blanchiment.component';
import { SmileComponent } from './smile/smile.component';
import { FacettesComponent } from './facettes/facettes.component';
import { CouronnesComponent } from './couronnes/couronnes.component';
import { ChirurgieComponent } from './chirurgie/chirurgie.component';
import { ContactComponent } from './contact/contact.component';
import { AcceuilComponent } from './acceuil/acceuil.component';
import { CarouselModule } from 'ngx-bootstrap/carousel';
import { FooterComponent } from './footer/footer.component';


@NgModule({
  declarations: [
    AppComponent,
    NavbarComponent,
    CliniqueComponent,
    DocteurComponent,
    FACComponent,
    RealisationComponent,
    TemoignagesComponent,
    ConseilComponent,
    BlanchimentComponent,
    SmileComponent,
    FacettesComponent,
    CouronnesComponent,
    ChirurgieComponent,
    ContactComponent,
    AcceuilComponent,
    FooterComponent



  ],
  imports: [
    BrowserModule,
    AppRoutingModule,
    CarouselModule.forRoot()
  ],
  providers: [],
  bootstrap: [AppComponent]
})
export class AppModule { }
